import './App.css';
import React from 'react'
import styles from './App.css';
import logo from '../pictures/Arcachon.jpg'

class City_illustration extends React.Component{
    constructor(props)
    {
        super(props);
        this.state = {path : ""};
    }

    static getDerivedStateFromProps(props, state) {
        return {path: props.path};
    }

    render(){
        return(
            <div className = "Tallin_pic">
                <img src={this.state.path}></img>
            </div>
        )
    }
}

export default City_illustration;
